    </button>
  )
}

const CButton = (props) => {
  return (
    <button className="info-button">
      Context
    </button>
  )
}

const EButton = (props) => {
  return (
    <button className="info-button">
      Example
    </button>
  )
}

const ViewAll = (props) => {
  return (
    <button className="view-all">
      All
    </button>
  )
}

const InfoButtonWrapper = () => {
  return (
    <aside className="info-button-wrapper">
          <DButton />
          <IButton />
          <CButton />
          <EButton />
          <ViewAll />
    </aside>
  )
}
export { InfoButtonWrapper }
